,'СП117','Стол с бортом, 600*600*870 мм.\nКаркас разборный, собирается с помощью болтов М6. В комплект входит разборная полка-решетка. Материал столешницы: нержавеющая сталь AISI 430 толщиной 0,8 мм. Края столешницы имеют подгиб для предотвращения травматизма персонала. Столешница усилена подложкой из ламинированной ДСП толщиной 16 мм. Толщина столешницы – 40 мм. Материал каркаса: оцинкованная сталь толщиной 1,2 мм.','',''),('bca78628-b181-11e1-a217-003048574192','МХМ Стол разделочный с бортиком СРП-1-0,6/1,2','','2000000262918','СП109','С бортом, 1200х600х880 мм. Каркас-оцинк. сталь. Без полки','',''),('ca9d4ec6-b181-11e1-a217-003048574192','ATESY Мукопросеиватель \"Каскад\"','','2000000059204','СП146','452*620*870см, 380В,  производительность не менее 150кг/ч; объём бункера 40л\nВибрационный просеиватель муки «Каскад» предназначен для просеивания, разрыхления и обогащения воздухом (аэрации) основного кулинарного ингредиента – муки. Мукопросеиватель также используется для удаления из муки металлических вкраплений и посторонних частиц. Принцип действия установки заключается в использовании вибрирующего сита, через которое порциями (не более 5 кг за прием) пропускается мука. Мукопросеиватель снабжен устройством магнитного уловителя (сепарирования), необходимого для удержания на своей поверхности металлических частиц. ','',''),('d1733e43-b181-11e1-a217-003048574192','ATESY Колода разрубочная КР-500/800','','2000000060712','ОТ959','Колода для рубки мяса изготавливается из наборного бука, что обуславливает ее прочность и надежность.\nИспользуется на предприятиях общественного питания и мясоперерабатывающих заводах.\nКолода КР-500/800 состоит из двух частей: рабочей, выполненной из КЛЕЕННОГО бука и металлической подставки выполненной из нержавеющей стали. Выдерживает нагрузку до 250кг.','',''),('d7f5bbbe-b181-11e1-a217-003048574192','ATESY Шаурма - Установка для приготовления мяса Шаурма 2М газовая','','2000000063690','СП142','Установка газовая для приготовления мяса двухгорелочная. Все корпусные элементы установок изготовлены из нержавеющей стали. В комплект входят 8 шампуров для шашлыка335*620*865 мм, 2 горелки, 8 шампуров, вес 19,5 кг','',''),('d7f5bbc4-b181-11e1-a217-003048574192','ATESY Шаурма - Установка для приготовления мяса Шаурма-3 ЭЛ  М-Э','','2000000063720','СП145','Установка для приготовления мяса электрическая. Все корпусные элементы установок изготовлены из оцинкованной стали. Нагрев производится посредством трубчатых электронагревателей (ТЭНов). ТЭНы создают инфракрасное излучение, которое фокусируется экранами, расположенными между ТЭНами и корпусом установки, тем самым увеличивая температуру жарки мяса и скорость его приготовления. Приводом для вращения цилиндра с мясом служит электромотор.','',''),('d7f5bbe5-b181-11e1-a217-003048574192','ATESY Блинница \"Масленница\" БА-2/5','','2000000064000','СП611','с двумя конфорками d 360 мм, 810*420*300 мм, 220 В.\nБлинный аппарат представляет собой пьедестал, выполненный из нержавеющей стали, на котором располагаются две жарочные поверхности диаметром 36 см. Конфорки аппарата выполнены из разрешенного для использования в системе общественного питания термостойкого чугуна, что определяет высокую устойчивость поверхности к механическим повреждениям. Производительность – 120 блинов/час. Регулировка температуры поверхности осуществляется с помощью терморегулятора.','',''),('d7f5bbe7-b181-11e1-a217-003048574192','ATESY Блинница \"Масленница\" БА-1/2,5','','2000000064017','ОБ771','Блинный аппарат представляет собой пьедестал, выполненный из нержавеющей стали, на котором располагается одна жарочная поверхность диаметром 36 см. Конфорки аппарата выполнены из разрешенного для использования в системе общественного питания термостойкого чугуна, что определяет высокую устойчивость поверхности к механическим повреждениям. Производительность – 60 блинов/час. Регулировка температуры поверхности осуществляется с помощью терморегулятора.','',''),('d7f5bc29-b181-11e1-a217-003048574192','CB 